import React from "react";

import Layout from "./Layout";
import { useSelector } from "react-redux";
function Account() {
    const { user } = useSelector((state) => state.auth);
  return (
    <Layout>
      <div>
  <p>{user && user.name}</p>
  <p>{user && user.email}</p>

      </div>
    </Layout>
  );
}

export default Account;
